"use strict";(self.webpackChunkajudafacitysistemas=self.webpackChunkajudafacitysistemas||[]).push([[1380],{4255:(o,s,a)=>{a.r(s),a.d(s,{assets:()=>c,contentTitle:()=>r,default:()=>p,frontMatter:()=>n,metadata:()=>i,toc:()=>l});var t=a(4848),e=a(8453);const n={title:"Como gerar relat\xf3rios de comiss\xe3o/gar\xe7om?"},r=void 0,i={id:"relatorios/como-gerar-relatorios-de-comissao-garcom-",title:"Como gerar relat\xf3rios de comiss\xe3o/gar\xe7om?",description:"<div dangerouslySetInnerHTML={{ html: `",source:"@site/docs/relatorios/como-gerar-relatorios-de-comissao-garcom-.mdx",sourceDirName:"relatorios",slug:"/relatorios/como-gerar-relatorios-de-comissao-garcom-",permalink:"/ajudafacitysistemas/en/docs/relatorios/como-gerar-relatorios-de-comissao-garcom-",draft:!1,unlisted:!1,editUrl:"https://github.com/ajudafacity/ajudafacitysistemas/edit/main/docs/relatorios/como-gerar-relatorios-de-comissao-garcom-.mdx",tags:[],version:"current",frontMatter:{title:"Como gerar relat\xf3rios de comiss\xe3o/gar\xe7om?"},sidebar:"tutorialSidebar",previous:{title:"Como gerar relat\xf3rio de vendas?",permalink:"/ajudafacitysistemas/en/docs/relatorios/como-gerar-relatorio-de-vendas-"},next:{title:"Como gerar relat\xf3rios de delivery?",permalink:"/ajudafacitysistemas/en/docs/relatorios/como-gerar-relatorios-de-delivery-"}},c={},l=[];function g(o){return(0,t.jsx)(t.Fragment,{children:(0,t.jsx)(t.Fragment,{children:(0,t.jsx)("div",{dangerouslySetInnerHTML:{__html:'\n  \n<p class="has-small-font-size">Neste post, vamos te ensinar a gerar relat\xf3rios de comiss\xe3o/gar\xe7om utilizando o<strong> Facity Controle</strong>. Confira abaixo o passo a passo:</p>\n\n\n\n<p class="has-small-font-size"><strong>Passo 1: </strong>Abra o <strong>Facity Controle</strong> em seu computador</p>\n\n\n\n<p class="has-small-font-size">Acesse o programa<strong> Facity Controle</strong> em seu computador e insira o<strong> nome da empresa</strong>, <strong>login</strong> e <strong>senha</strong>. Lembre-se que tudo deve ser digitado em <em>letras min\xfasculas</em>.</p>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="http://blog.facity.com.br/wp-content/uploads/2022/11/image-48.png" alt="" class="wp-image-903" width="1023" height="622" srcset="https://blog.facity.com.br/wp-content/uploads/2022/11/image-48.png 900w, https://blog.facity.com.br/wp-content/uploads/2022/11/image-48-300x182.png 300w, https://blog.facity.com.br/wp-content/uploads/2022/11/image-48-768x467.png 768w, https://blog.facity.com.br/wp-content/uploads/2022/11/image-48-720x438.png 720w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 2:</strong> Clique em <strong>RELAT\xd3RIOS</strong> no menu lateral a esquerda</p>\n\n\n\n<p class="has-small-font-size">Ap\xf3s acessar o programa, clique na op\xe7\xe3o <strong>&#8220;Relat\xf3rios&#8221;</strong> no menu lateral \xe0 esquerda da tela.</p>\n\n\n\n<figure class="wp-block-image size-large"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1024" height="486" src="http://blog.facity.com.br/wp-content/uploads/2022/11/image-49-1024x486.png" alt="" class="wp-image-904" srcset="https://blog.facity.com.br/wp-content/uploads/2022/11/image-49-1024x486.png 1024w, https://blog.facity.com.br/wp-content/uploads/2022/11/image-49-300x142.png 300w, https://blog.facity.com.br/wp-content/uploads/2022/11/image-49-768x364.png 768w, https://blog.facity.com.br/wp-content/uploads/2022/11/image-49-720x342.png 720w, https://blog.facity.com.br/wp-content/uploads/2022/11/image-49.png 1307w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 3: </strong>Clique em <strong>GAR\xc7OM</strong></p>\n\n\n\n<p class="has-small-font-size">Na tela de relat\xf3rios, escolha a op\xe7\xe3o <strong>&#8220;Gar\xe7om&#8221;</strong>.</p>\n\n\n\n<figure class="wp-block-image size-large"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1024" height="468" src="http://blog.facity.com.br/wp-content/uploads/2022/11/gacomeditc-1024x468.png" alt="" class="wp-image-905" srcset="https://blog.facity.com.br/wp-content/uploads/2022/11/gacomeditc-1024x468.png 1024w, https://blog.facity.com.br/wp-content/uploads/2022/11/gacomeditc-300x137.png 300w, https://blog.facity.com.br/wp-content/uploads/2022/11/gacomeditc-768x351.png 768w, https://blog.facity.com.br/wp-content/uploads/2022/11/gacomeditc-720x329.png 720w, https://blog.facity.com.br/wp-content/uploads/2022/11/gacomeditc.png 1337w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 4:</strong> Escolha uma <strong>data inicial </strong>e uma <strong>data final</strong></p>\n\n\n\n<p class="has-small-font-size">Informe a data inicial e a data final do per\xedodo que deseja gerar o relat\xf3rio. \xc9 importante lembrar que o filtro de datas s\xf3 pode ser feito para um per\xedodo de 30 dias.</p>\n\n\n\n<p class="has-small-font-size"><strong>Passo 5:</strong> Busque pelo nome na barra de pesquisa</p>\n\n\n\n<p class="has-small-font-size">Caso queira filtrar o relat\xf3rio pelo <strong>nome do gar\xe7om</strong>, voc\xea pode digitar o nome desejado na barra de pesquisa.</p>\n\n\n\n<figure class="wp-block-image size-large"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1024" height="494" src="http://blog.facity.com.br/wp-content/uploads/2022/11/buscaredit-1024x494.png" alt="" class="wp-image-906" srcset="https://blog.facity.com.br/wp-content/uploads/2022/11/buscaredit-1024x494.png 1024w, https://blog.facity.com.br/wp-content/uploads/2022/11/buscaredit-300x145.png 300w, https://blog.facity.com.br/wp-content/uploads/2022/11/buscaredit-768x371.png 768w, https://blog.facity.com.br/wp-content/uploads/2022/11/buscaredit-720x348.png 720w, https://blog.facity.com.br/wp-content/uploads/2022/11/buscaredit.png 1307w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 6:</strong> Clique em <strong>BUSCAR</strong> para gerar relat\xf3rio de comiss\xe3o/gar\xe7om</p>\n\n\n\n<p class="has-small-font-size">Ap\xf3s inserir todas as informa\xe7\xf5es necess\xe1rias, clique em <strong>&#8220;Buscar&#8221;</strong> para gerar o relat\xf3rio de comiss\xe3o/gar\xe7om.</p>\n\n\n\n<p class="has-small-font-size">Pronto! Agora voc\xea sabe como gerar relat\xf3rios de comiss\xe3o/gar\xe7om utilizando o<strong> Facity Controle</strong>. Com essas informa\xe7\xf5es, voc\xea pode ter um controle mais eficiente sobre as comiss\xf5es dos seus funcion\xe1rios.</p>\n\n'}})})})}function p(o={}){const{wrapper:s}={...(0,e.R)(),...o.components};return s?(0,t.jsx)(s,{...o,children:(0,t.jsx)(g,{...o})}):g()}},8453:(o,s,a)=>{a.d(s,{R:()=>r,x:()=>i});var t=a(6540);const e={},n=t.createContext(e);function r(o){const s=t.useContext(n);return t.useMemo((function(){return"function"==typeof o?o(s):{...s,...o}}),[s,o])}function i(o){let s;return s=o.disableParentContext?"function"==typeof o.components?o.components(e):o.components||e:r(o.components),t.createElement(n.Provider,{value:s},o.children)}}}]);